  //   fetchSystems();
  // }, []); // 빈 배열은 한 번만 호출하도록 설정

  return (
      <div>
        <Card>
          <CardBody>
            {/*<CardTitle tag="h5">Project Listing</CardTitle>*/}
            {/*<CardSubtitle className="mb-2 text-muted" tag="h6">*/}
            {/*  Overview of the projects*/}
            {/*</CardSubtitle>*/}

            <Table className="no-wrap mt-3 align-middle text-center" Table bordered hover >
              <thead>
              <tr>
                <th><input
                    type="checkbox"
                    // checked={checkboxes.every(checkbox => checkbox.checked)}
                    // onChange={handleSelectAll}
                /></th>
                <th>시스템명</th>
                <th>시스템유형</th>
                <th>IP</th>
                <th>계정수</th>
                <th>관리자</th>
                <th>동기화일자</th>
                <th>동기화여부</th>
              </tr>
              </thead>
              <tbody>
              {systems.map((system, index) => (
                  <tr key={index} className="border-top">
                    <td>
                      {/*{checkboxes.map(checkbox => (*/}
                      {/*    <div key={checkbox.id}>*/}
                      {/*      <label>*/}
                      {/*        <input*/}
                      {/*            type="checkbox"*/}
                      {/*            checked={checkbox.checked}*/}
                      {/*            // onChange={() => handleCheckboxChange(checkbox.id)}*/}
                      {/*        />*/}
                      {/*        {checkbox.label}*/}
                      {/*      </label>*/}
                      {/*    </div>*/}
                      {/*))}*/}
                    </td>

                    <td>
                      {/*<img*/}
                      {/*  src={system.systemName}*/}
                      {/*  className="rounded-circle"*/}
                      {/*  alt="systemName"*/}
                      {/*  width="45"*/}
                      {/*  height="45"*/}
                      {system.systemName}
                    </td>
                    <td>{system.systemCategory}</td>
                    <td>{system.ipAddr}</td>
                    {/*<td>{system.weeks}</td>*/}
                    {/*<td>{system.admin}</td>*/}
                    {/*<td>{system.budget}</td>*/}
                    <td>
                      {/*{system.status === "N" ? (*/}
                      {/*    <span className="p-2 bg-danger rounded-circle d-inline-block"></span>*/}
                      {/*) : (*/}
                      {/*    <span className="p-2 bg-success rounded-circle d-inline-block"></span>*/}
                      {/*)}*/}
                    </td>
                  </tr>
              ))}
              </tbody>
            </Table>
          </CardBody>
        </Card>
      </div>
  );
}

export default ProjectTable;





